import { Link } from 'react-router-dom';

function HomePage() {
    return (
        <>
            <div class="container">
                <div class="toppane">Welcome to Acme Inc to your Hub!</div>

                <div class="leftpane">
                    <h1>Reccomended Resource 1</h1>
                    <h1>Reccomended Resource 2</h1>
                </div>

                <div class="middlepane">Test Page</div>

                <div class="rightpane">
                    <h1>Test Page</h1></div>
            </div>
            {/* <h1>Home Page</h1>
            <Link className="App-link" to="/shoppinglist">Go to the Shopping List Page</Link>
            <Link className="App-link" to="/storelist">Go to the Store List Page</Link> */}
        </>
    );
}

export default HomePage;
